import { Component } from "react"
class Output extends Component {
  constructor(props){
    super(props)
    this.state={
      value: this.props.value
    }
  }
  render(){
    return (
      <section className='flex-1'>
          <textarea className='w-full border h-screen border-l-orange-500 text-black'>{this.props.value}</textarea>
      </section>
    )
  }
}
export default Output;
